import React from 'react';
import "./Navbar.css";
import logo from "./comarca-logo-ok.png"

//BOOTSTRAP
import "bootstrap/dist/css/bootstrap.min.css";

import { Container, Navbar, Button , Nav, Row } from 'react-bootstrap';

function navbar() {
    return (
        <Container>
            <Navbar fixed="top" className="navContainer">
                <Row>
                    <Navbar.Brand href="index.html">
                        <img
                            src= {logo}
                            width="100"
                            height="auto"
                            className="d-inline-block align-top"
                            alt="Comarca de creadores logo"
                        />
                    </Navbar.Brand>
                    <Navbar.Toggle aria-controls="basic-navbar-nav" />
                    <Navbar.Collapse className="navtabs" id="basic-navbar-nav">
                        <Nav >
                            <Nav.Link className="navitem" href="#home">Tienda</Nav.Link>
                            <Nav.Link className="navitem" href="#link">Talleres</Nav.Link>
                            <Button className="cartButton">Carrito</Button>
                        </Nav>
                    </Navbar.Collapse>
                </Row>

            </Navbar>
        </Container>

    );
};

export default navbar;
